package operators.packages;

public class Logicalop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		// Logical && ,||
		
		int a=5;
		int b=4;
		boolean f1=true;
		boolean f2=false;
		
		boolean f5=(a<b)&&f1;
		
System.out.println(f5);
		boolean f3=f1&&f2;
		System.out.println(f3);
		
		
		boolean f4=f1||f2;
		System.out.println(f4);

	}

}
